            getBasicHeader(ClusterIdCheck.CHECK, EpochCheck.CHECK),
            getStreamsAddressResponseMsg(defaultLogTail, defaultEpoch, defaultMap)
    );

    sequencerHandler.handleMessage(response, mockChannelHandlerContext);
