        cluster.await( ClusterManager.masterSeesSlavesAsAvailable( 1 ) );

        // when

        // Create 20 concurrent transactions
        System.out.println( "Pull storm" );
        ExecutorService executor = Executors.newFixedThreadPool( 20 );
        for ( int i = 0; i < 20; i++ )
