  given(omKeyInfo3.getKeyName()).willReturn("key1");
  given(omKeyInfo3.getVolumeName()).willReturn("vol2");
  given(omKeyInfo3.getBucketName()).willReturn("bucket1");
  given(omKeyInfo3.getDataSize()).willReturn(1000L);

