    asyncFuncMaps.clear();
    asyncFuncMaps.put("doInBackground", DO_IN_BG);
    asyncFuncMaps.put("onPreExecute", ON_PRE_EXE);
    asyncFuncMaps.put("onPostExecute", ON_POS_EXE);
