    int full = 0, ret = 0;
    for(String key: asyncFuncMaps.keySet())
    {
        full |= asyncFuncMaps.get(key);
    }

    for (Edge edge : Scene.v().getCallGraph()) {
        String sig = edge.getTgt().method().toString();
        for (String key : asyncFuncMaps.keySet()) {
